import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch
} from 'react-router-dom'
import Items from '../api/controller/buscarterminos.php'

class Nav extends Component{
    render(){
        return(
            
                <nav>
                    <ul>
                        <li>
                            <Link to="/buscarterminos" className="hola">Items</Link>
                        </li>
                    </ul>
                </nav>
            
        );
    }

}
export default Nav;
